import { Link } from "react-router-dom";
import RegistrationForm from "../Example/RegistrationForm/RegistrationForm";

const RegisterLink = () => {
  return (
    <>
      <h3>I don't have an account</h3>
      <Link to="/RegistrationForm">Register!</Link>
    </>
  );
};

export default RegisterLink;
